import React, { Component } from 'react'
import { Row, Col, Divider } from 'antd';
import "./content.css"
import NavLeft from './nav/NavLeft';

class Nav extends Component {
    render() {
        return (
            <div className="nav">
                <Row gutter={16}>
                    <Col span={6}><NavLeft/></Col>
                    <Col span={12}>2</Col>
                    <Col span={6}>3</Col>
                </Row>
            </div>
        )
    }
}

export default Nav;
